import React, { Component } from "react";

const NewsBox = {
    backgroundColor: "pink",
    minHeight: "400px",
    width: "100%",
    margin: "15px",
    padding: "15px"
}

class News extends Component {
    render() {
        return (
            <div style={{ padding: "70px 40px"}}>
                <div style={{display: "flex", justifyContent: "center"}}>
                    <div style={NewsBox}><h3 style={{margin: 0, fontSize: "25px"}}>Best Wallet Award</h3><p>Now equipped with seventh-generation Intel Core processors, MacBook is snappier than ever.</p><a style={{}} href="#">READ MORE</a></div>
                    <div style={NewsBox}><h3 style={{margin: 0, fontSize: "25px"}}>Best Wallet Award</h3><p>Now equipped with seventh-generation Intel Core processors, MacBook is snappier than ever.</p><a style={{}} href="#">READ MORE</a></div>
                    <div style={NewsBox}><h3 style={{margin: 0, fontSize: "25px"}}>Best Wallet Award</h3><p>Now equipped with seventh-generation Intel Core processors, MacBook is snappier than ever.</p><a style={{}} href="#">READ MORE</a></div>
                </div>
            </div>
        );
    }
}
export default News;
